        console.log(this.cartes);
    }


    initCartes()
    {
        let tempTabCartes = [];
        let nbCartes = 0;


        for(let j = 0 ; j < 13 ; j++)
        {
            tempTabCartes.push(new Carte(j, "Coeur", false));
            tempTabCartes.push(new Carte(j, "Trefle", false));
            tempTabCartes.push(new Carte(j, "Pique", false));
            tempTabCartes.push(new Carte(j, "Carreau", false));
        }

        return tempTabCartes;
    }

}

function PlateauComposant()
{
    let plateau = new Plateau;


